/**
 * Gets the data URI for the favicon.
 * @returns A string representing the favicon data URI.
 */
export function getFaviconDataUri(): string {
	return "data:image/vnd.microsoft.icon;base64,".split(
		","
	)[1];
}

/**
 * Gets the data URI for the logo.
 * @returns A string representing the logo data URI.
 */
export function getLogoDataUri(): string {
	return "data:image/png;base64,".split(
		","
	)[1];
}